When I processed the original back in March, I was still learning a lot about HDR, and the resulting file wasn't truly what I was looking for.  I still loved the shot at the time, but still felt it had a number of flaws.  I've been learning and refining my workflow over the past year, and decided to finally revisit this image.

The version you see now is much more in line with what I had originally hoped it would be, but my skills at the time weren't quite commensurate with my vision.  Hope you like the newer one as much as I do!

